import styles from "./NavMenu.module.scss";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import Container from "react-bootstrap/Container";
import { NavLink } from 'react-router-dom';

const NavMenu = () => {
    return (

        <Navbar className={styles.Navbar} collapseOnSelect expand="lg" bg="dark-success" variant="dark">
            <Container  >
                <Navbar.Brand className='application' href="#">our application</Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                    <Nav className="me-auto">

                        <NavLink className={styles.navItem} to="/">Home</NavLink>
                        <NavLink activeClassName={styles.active} className={styles.navItem} to="/nutrition-analysis">Nutrition analysis</NavLink>
                        <NavLink activeClassName={styles.active} className={styles.navItem} to="/recipes">Recipes</NavLink>
                        <NavLink activeClassName={styles.active} className={styles.navItem} to="/bmi">BMI</NavLink>
                        <NavLink activeClassName={styles.active} className={styles.navItem} to="/articles">Articles</NavLink>

                    </Nav>
                    <Nav>
                        <NavLink activeClassName={styles.active} className={styles.navItem} eventKey={2} to="/login">Login</NavLink>
                        <NavLink activeClassName={styles.active} className={styles.navItem} to="/register">Register</NavLink>
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>

    );
};

export default NavMenu;
